module.exports = async d => {
    const code = d.command.code

    const r = code.split("$customEmoji[").length - 1

    const inside = code.split("$customEmoji[")[r].split("]")[0]

    return {
        code: code.replaceLast(`$customEmoji[${inside}]`, `${d.client.emojis.cache.find(e => e.name.toLowerCase() === inside.toLowerCase()) || "" }`)
    }
}